const styles = theme => ({
    root: {
        display: 'flex',
        marginBottom: theme.spacing(4),
        padding: theme.spacing(1, 4, 1, 3),
        // maxWidth: theme.spacing(115),
        width: "50vw",
    },
    content: {
        flexGrow: 1,
    },
    details: {
        display: 'flex',
        flexDirection: 'row',
        marginTop: theme.spacing(1),
    },
    detailsItem: {
        margin: theme.spacing(0, 2, 0, 0),
    },
    actions: {
        display: 'flex',
        flexDirection: 'row',
    },
    actionItem: {
        margin: theme.spacing(0, 1, 0, 1),
    },
});

export default styles;
